import React, { Component } from 'react';
import LogInElt from './LogInElt'

class LogIn extends Component {
    constructor(props) {
        super(props)
        this.state = {
            typeOf: "SignIn",
        }
    }

    render() {
        return (
            <LogInElt typeOf={this.state.typeOf} />
        )

    }
}

export default LogIn;
